import axios from 'axios'

const proxy = 'http://localhost:3000/users'

export function getAccountPaper(){
  const url = proxy+'/test'
  return axios.get(url)
}

export function createUser() {
  const url = proxy
  const data = {
    name: 'hello',
    email: '123',
    password: '123'
  }
  return axios.post(url, data)
}
